import React from 'react';
import Card from './Card';

const CardList = ({ kanji }) => {
	const cardComponent = kanji.map((aKanji, i) => { 
		return (
			<Card 
			key={i} 
			character={kanji[i].character} 
			reading={kanji[i].kunyomi+" "+kanji[i].onyomi}
			meaning={kanji[i].meaning}
			/>
		);
	})

	return(		
		<div>
			{cardComponent}
		</div>

	);
}

export default CardList;

